import React from 'react'
import {Footer,
        FooterText,
        DonationsBtn,
        DonationsLink} from './Footer'

function index() {
    return (
        <Footer>
            <FooterText>
                @Croco-OS
            </FooterText>
            <DonationsBtn>
                <DonationsLink>
                    Donations
                </DonationsLink>
            </DonationsBtn>
        </Footer>
    )
}

export default index
